import React, { useState } from "react";
import { makeStyles, Theme, createStyles } from "@material-ui/core/styles";
import Button from "@material-ui/core/Button";
import TextField from "@material-ui/core/TextField";
import Dialog from "@material-ui/core/Dialog";
import DialogActions from "@material-ui/core/DialogActions";
import DialogContent from "@material-ui/core/DialogContent";
import DialogContentText from "@material-ui/core/DialogContentText";
import DialogTitle from "@material-ui/core/DialogTitle";
import Grid from "@material-ui/core/Grid";
interface ContactModalProps {
  open: boolean;
  clickOpen: () => void;
  clickClose: () => void;
}

const useStyles = makeStyles((theme: Theme) =>
  createStyles({
    dialog: {
      padding: "10px",
    },
    fullWidthField: {
      width: "100%",
    },
    gridContainer: {
      paddingBottom: "10px"
    }
  })
);

export const ContactModal = (props: ContactModalProps) => {
  const classes = useStyles();
  return (
    <Dialog
      open={props.open}
      onEscapeKeyDown={props.clickClose}
      onBackdropClick={props.clickClose}
    >
      <div className={classes.dialog}>
        <DialogTitle>Thank you for joing the greenly community</DialogTitle>
        <Grid container className={classes.gridContainer}>
          <Grid item xs={6}>
            <TextField label="First" variant="outlined" size="small" />
          </Grid>
          <Grid item xs={6}>
            <TextField label="Last" variant="outlined" size="small" />
          </Grid>
        </Grid>

        <Grid container className={classes.gridContainer}>
          <TextField
            label="Email"
            className={classes.fullWidthField}
            variant="outlined"
            size="small"
          />
        </Grid>

        {/* dropdown with reason for reaching out */}
        <Grid container className={classes.gridContainer}>
          <TextField
            label="Your Message Here"
            multiline
            rows={8}
            className={classes.fullWidthField}
            variant="outlined"
            size="small"
          />
        </Grid>
      </div>
      <Button>Submit</Button>
    </Dialog>
  );
};
